const API_BASE_URL = 'https://api.tvmaze.com';
export async function apiGet(queryString) {
  const response = await fetch(`${API_BASE_URL}${queryString}`);

  fetch(`https://api.tvmaze.com/search/shows?q=${input}`).then(r => r.json());
  return response;
}
